import React from 'react';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import CssBaseline from '@mui/material/CssBaseline';
import { ThemeProvider } from '@mui/material/styles'
import useMediaQuery from '@mui/material/useMediaQuery';;
import { theme } from './theme';
import FacilityViewPage from './pages/FacilityViewPage';
import ResultPage from './pages/ResultPage';
import FacilitiesPage from './pages/FacilitiesPage';
import NotFound from './pages/NotFound';

function App() {

  const isMobile = useMediaQuery('(min-width:900px)');
  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <div>
        {isMobile ? (
          <BrowserRouter>
            <Routes>
              <Route exact path="/facilities/view" element={<FacilityViewPage />} />
              <Route exact path="/facilities/result" element={<ResultPage />} />
              <Route exact path="/facilities" element={<FacilitiesPage />} />
              <Route exact path="/" element={<FacilitiesPage />} />
              <Route element={<NotFound />} />
            </Routes>
          </BrowserRouter>
        ) : (
          <NotFound isNotMobile/>
        )}
      </div>
    </ThemeProvider>
  );
}

export default App;
